import { useLexicalComposerContext } from '@lexical/react/LexicalComposerContext';
import { TreeView } from '@lexical/react/LexicalTreeView';

export default function TreeViewPlugin() {
    const [editor] = useLexicalComposerContext();
    return <TreeView viewClassName="tree-view-output" treeTypeButtonClassName="debug-treetype-button" timeTravelPanelClassName="debug-timetravel-panel" timeTravelButtonClassName="debug-timetravel-button" timeTravelPanelSliderClassName="debug-timetravel-panel-slider" timeTravelPanelButtonClassName="debug-timetravel-panel-button" editor={editor} />;
}
